<!DOCTYPE html>
<html>
<head>
  <meta charset="utf-8" />
  <title>ArchNet API Docs - ReDoc</title>
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <style>html,body,#redoc-container{height:100%%;} body{margin:0;padding:0;}</style>
</head>
<body>
  <div id="redoc-container"></div>
  <script>
  (function(){
    function render(){ if (window.Redoc) { window.Redoc.init("./archnets.json", {}, document.getElementById("redoc-container")); } }
    function addScript(src, onload){ var s=document.createElement("script"); s.src=src; s.onload=onload; document.head.appendChild(s); }
    if (window.Redoc) { render(); } else {
      addScript("https://cdn.redoc.ly/redoc/latest/bundles/redoc.standalone.js", function(){ render(); setTimeout(function(){ if (!window.Redoc) addScript("https://unpkg.com/redoc@next/bundles/redoc.standalone.js", render); }, 1000); });
    }
  })();
  </script>
</body>
</html>
